import React from 'react';
import Header from './components/Header';
import Banner from './components/Banner';
import About from './components/About'; // Assuming About section is ready
import Empanelment from './components/BankLogos'; // Empanelment section
import Contact from './components/Contact'; // Contact section
import Footer from './components/Footer';

function App() {
  return (
    <div className="app-container">
      <Header />

      <main className="main-content">
        <section id="banner">
          <Banner />
        </section>

        <section id="about">
          <About />
        </section>

        <section id="empanelment">
          <Empanelment />
        </section>

        <section id="contact">
          <Contact />
        </section>
      </main>

      <Footer /> {/* Add Footer component here */}
    </div>
  );
}

export default App;
